  false,\n\t\"url\": null,\n\t\"notes\": \"The present collection is the latest in
  a series of publications within the framework of the Soviet-Japanese convention,
  \"The Protection of Migratory Birds and Endangered Bird Species and Their Habitats\".
  This collection contains new information about the seabirds of the Far East based
  on direct observation by specialists over the past 10-15 years and to a large extent
  sums up research on seabirds in this region. Unedited translation for information
  only. As a region, the Far East is located at the edge of the Asian continent with
  an extensive coastline which is lapped by the waters of the Chukotsk, Bering, Okhotsk
  Seas, the Sea of Japan, and the Arctic and Pacific Oceans.\",\n\t\"owner_org\":
